import React from "react";
import { headData } from "./data";
import MyTypography from "./MyTypography";

function TopBarItems(props) {
  return headData.map((item) => {
    return (
      <MyTypography key={item.id} {...props}>
        {item.name}
      </MyTypography>
    );
  });
}

export default TopBarItems;
